import React, { Component } from "react";
import Layout from "../components/Layout";
import { Segment, Header, Image, List, Grid, Card } from "semantic-ui-react";

class index extends Component {
  render() {
    return (
      <Layout>
        <Card>
          <Card.Content>
            <Card.Header textAlign="center">User</Card.Header>
          </Card.Content>
          <Card.Content>
            <List>
              <div icon="lock"></div>
            </List>
          </Card.Content>
        </Card>
      </Layout>
    );
  }
}

export default index;
